import React from 'react';

class LateralMenu extends React.Component{
	render(){
		return(
			<div>
				<p>Companies</p>
				<p>Usuários</p>
				<p>Resetar Senha</p>
				<p>Simulação</p>
			</div>
		);
	}
}

export default LateralMenu;
